            3D
          </div>
          <div
            className={` ${buttonClass} ${
              infoClicked && "bg-black text-white"
            }`}
            onClick={() => setInfoClicked(!infoClicked)}
          >
            ?
          </div>
        </div>
      </div>
    </div>
  );
};

export default Title;
